import React, { Component } from 'react';
import { Route, Link } from 'react-router-dom';


class NavigationButton extends Component {

    viewPost = ID => {
        this.props.navigatePost(ID);
    };

    render() {
        return (
            <div>

                <Link
                to={`/posts/` + (this.props.ID)}
                >Open</Link>

            </div>
        );
    }
}

export default NavigationButton;
